import Footer from "./Footer";
import Header from "./Header";

export default function Home() {
  return (
    <>
      <Header />
      <section>
        <div>
          <h4>Chào mừng bạn đến với "Thiên đường Sách"</h4>
        </div>
      </section>
      <Footer />
    </>
  );
}
